“When one door closes another door opens.” 

When I first auditioned for the Heat, I made it through the first 3 cuts, a week of intensive boot camp, and made it to the final show/audition night. I didn’t make it. (Friday)

The very next day I flew home to Philly. (Saturday)

The next day, I drove to Newark, New Jersey for yet another audition. (Sunday) 

That day I became New Jersey Devil’s Dancer. 🏒 

I definitely learned some lessons and experienced some adversity through this year.... BUT..... I also made a couple of life long friends and prepared myself for the following year when I finally became a Heat Dancer! 

A lot of people would have seen me hopping on a plane from Miami and accepting my defeat to go home..... little did they know I was just going after another opportunity for success which lead to an even bigger success later! 

It’s all about perspective. 

Keep going.

